// src/components/Quiz.js
import React, { useEffect, useState } from "react";
import { PieChart, Pie, Cell, Tooltip, Legend } from "recharts";

function Quiz({ quizFile }) {
  const [questions, setQuestions] = useState([]);
  const [scoring, setScoring] = useState(null);
  const [results, setResults] = useState({});
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [answers, setAnswers] = useState([]);
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch(`/quizzes/${quizFile}`)
      .then((res) => {
        if (!res.ok) throw new Error(`Failed to fetch ${quizFile}`);
        return res.json();
      })
      .then((data) => {
        if (!data.questions) {
          throw new Error("Invalid quiz file format.");
        }
        setQuestions(data.questions);
        setScoring(data.scoring || null);
        setResults(data.results || {});
      })
      .catch((err) => setError(err.message));
  }, [quizFile]);

  const handleAnswer = (answer) => {
    setAnswers([...answers, answer]);
    if (currentQuestionIndex + 1 < questions.length) {
      setCurrentQuestionIndex(currentQuestionIndex + 1);
    } else {
      calculateResult([...answers, answer]);
    }
  };

  const calculateResult = (finalAnswers) => {
    let resultObj = null;

    if (scoring && scoring.method === "average") {
      const total = finalAnswers.reduce((a, b) => a + Number(b), 0);
      const avg = total / finalAnswers.length;
      let level = "Low";
      if (avg >= 3.5) level = "High";
      else if (avg >= 2.5) level = "Moderate";

      resultObj = { average: avg.toFixed(2), level, description: results[level] };
    } else if (scoring && scoring.method === "conflict_styles") {
      const styles = {
        Avoiding: 0,
        Compromising: 0,
        Competing: 0,
        Collaborating: 0,
        Accommodating: 0,
      };

      finalAnswers.forEach((ans, idx) => {
        const style = questions[idx].styles[ans];
        if (style) styles[style]++;
      });

      const entries = Object.entries(styles).map(([name, value]) => ({
        name,
        value,
      }));
      const top = entries.reduce((a, b) => (b.value > a.value ? b : a));

      resultObj = {
        type: top.name,
        count: top.value,
        breakdown: entries,
        description: results[top.name] || "",
      };
    }

    setResult(resultObj);
  };

  if (error) return <div className="quiz-error">Error: {error}</div>;
  if (!questions.length) return <div className="quiz-loading">Loading quiz...</div>;

  const currentQuestion = questions[currentQuestionIndex];

  if (result) {
    return (
      <section className="quiz-results">
        <h2>Your Result</h2>
        {result.average && <p>Average Score: {result.average}</p>}
        {result.level && <p>Level: {result.level}</p>}
        {result.type && <p>Dominant Style: {result.type}</p>}
        {result.description && <p>{result.description}</p>}

        {result.breakdown && (
          <PieChart width={400} height={300}>
            <Pie
              data={result.breakdown}
              dataKey="value"
              nameKey="name"
              cx="50%"
              cy="50%"
              outerRadius={100}
              label
            >
              {result.breakdown.map((entry, index) => (
                <Cell
                  key={`cell-${index}`}
                  fill={
                    ["#004B87", "#FF6F61", "#FFD700", "#4CAF50", "#8E44AD"][
                      index % 5
                    ]
                  }
                />
              ))}
            </Pie>
            <Tooltip />
            <Legend />
          </PieChart>
        )}
      </section>
    );
  }

  return (
    <section className="quiz">
      <h2>Question {currentQuestionIndex + 1}</h2>
      <p>{currentQuestion.question}</p>

      {currentQuestion.options &&
        Object.entries(currentQuestion.options).map(([key, text]) => (
          <button
            key={key}
            onClick={() => handleAnswer(key)}
            aria-label={`Answer ${key}`}
          >
            {text}
          </button>
        ))}

      {scoring && scoring.labels && !currentQuestion.options && (
        <div className="quiz-options">
          {Object.entries(scoring.labels).map(([value, label]) => (
            <button
              key={value}
              onClick={() => handleAnswer(value)}
              aria-label={`Answer ${label}`}
            >
              {label}
            </button>
          ))}
        </div>
      )}
    </section>
  );
}

export default Quiz;
